(30, 'en', 'Minto', 'minto', 'mindy@mailinator.com', 3, 1, NULL, 20, '2019-07-04 04:28:08', NULL, NULL, '29.967079', '77.551018', '+91', '9963663252', '$2y$10$5w9OeQZlb/wbkDgghQX3Ee0WJCSqmPXfNR4BqL.tbXS1mFcgEODI2', 'Relationship,Friendship,Daily Activities', 2, '34', 3, NULL, NULL, 'munnar', 'chartered accountant', 'reading', NULL, 'Chelsea legend Frank Lampard has returned to the London club as its new head coach on a three-year-deal.\nThe 41-year-old will replace Italian boss Murauzzio Sarri, who left to take charge of Serie A champion Juventus last month.\nConsidered one of the greatest players to have ever played at Stamford Bridge, Lampard left the Blues in 2014 having won three English Premier League titles during 13 years at the club.', 1, 1, 3, 3, 1, NULL, 2, '1562234720.png', '', '', '', NULL, NULL, NULL, 'english', 2, NULL, NULL, 1, NULL, NULL, 0, NULL, 'LD31SG', NULL, NULL, '0', '1', '1', '1', '0', '0', '2019-07-04 04:25:30', '2019-07-04 04:53:44', NULL, '94353300'),
(31, 'en', 'Janet', 'janet', 'janet@mailinator.com', 2, 1, NULL, 20, '2019-07-04 04:38:45', NULL, NULL, '30.733315', '76.779419', '+91', '1122334455', '$2y$10$vCZBoF1J3hE16ID6xWikf.K33pw/PV.CcqICod3fyCbp1v37jswN.', 'Relationship,Friendship,Daily Activities', 2, '45', 5, NULL, NULL, 'venice', 'rockstar', 'singing', NULL, 'The youngest child of the Jackson family, she began her career with the variety television series The Jacksons in 1976 and went on to appear in other television shows throughout the 1970s and early 1980s, including Good Times, Diff\'rent Strokes , and Fame. After signing a recording contract with A&M Records in 1982, she became a pop icon following the release of her third and fourth studio albums Control (1986) and Rhythm Nation 1814 (1989). Her collaborations with record producers Jimmy Jam and Terry Lewis incorporated elements of rhythm and blues, funk, disco, rap and industrial beats, which led to crossover success in popular music.\n\nIn 1991, Jackson signed the first of two record-breaking multimillion-dollar contracts with Virgin Records, establishing her as one of the highest-paid artists in the industry. Her fifth album Janet (1993) saw her develop a public image as a sex symbol as she began to explore sexuality in her music. That same year, she appeared in her first starring film role in Poetic Justice, and has since continued to act in feature films. Jackson then released her sixth studio album The Velvet Rope (1997), which is distinguished for its innovative production and dark lyrical content. By the end of the 1990s, she was named by Billboard magazine as the second most successful recording artist of the decade after Mariah Carey. Her seventh album All for You (2001) coincided with a celebration of her impact on the recording industry as the inaugural MTV Icon. After parting ways with Virgin Records, she released her tenth album Discipline (2008), her first and only album with Island Records. In 2015, she partnered with BMG Rights Management to launch her own record label, Rhythm Nation, and released her eleventh album Unbreakable the same year.\n\nHaving sold over 100 million', 1, 1, 3, 3, 1, NULL, 2, '1562235154.png', '', '', '', NULL, NULL, NULL, 'french', 2, NULL, NULL, 1, NULL, NULL, 0, NULL, 'BUJ67A', NULL, NULL, '0', '1', '1', '1', '0', '0', '2019-07-04 04:38:29', '2019-08-26 22:06:35', NULL, '94353670'),
